import React, { useRef } from 'react';
import { Inviter, SessionState, UserAgent, Registerer } from "sip.js";
import SIP from 'sip.js';

function Phone(props) {


    const SIP_USERNAME = '200-dataocean';
    const SIP_PASSWORD = 'RjH2TV2s9s8FHSpz';
    const SIP_DOMAIN = 'webrtc.1com.co.il';
    const SIP_SERVER = `wss://${SIP_DOMAIN}/ws`;

    const configuration = {
        uri: `sip:${SIP_USERNAME}@${SIP_DOMAIN}`,
        password: SIP_PASSWORD,
        transportOptions: {
            wsServers: [SIP_SERVER],
        },
    };

    const userAgent = new SIP.UA(configuration);

    const targetURI = `sip:+972534217014@${SIP_DOMAIN}`;

    userAgent.on('connected', () => {
        const session = userAgent.invite(targetURI);
        session.on('accepted', () => {
            console.log('Call accepted');
        });
        session.on('failed', () => {
            console.log('Call failed');
        });
        session.on('terminated', () => {
            console.log('Call ended');
        });
    });

    return (
        <div></div>
    );
}

export default Phone;
